VVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVU=\",\"mime\":\"audio/mpeg\",\"copyright\":{\"license\":\"U\"}}],\"playAudio\":\"Play audio\",\"pauseAudio\":\"Pause audio\",\"audioNotSupported\":\"Your browser does not support this audio\"},\"library\":\"H5P.Audio 1.5\",\"subContentId\":\"9d04c23a-169f-4e89-bcc2-4cff6a181b2a\",\"metadata\":{\"license\":\"U\",\"contentType\":\"Audio\",\"title\":\"Untitled Audio\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Audio\"}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><strong>Aladin et la lampe merveilleuse</strong></p>\\n\\n<p><em>Le maître d’Aladin, un méchant sorcier, lui a demandé d’aller chercher une lampe magique au fond d’une grotte contenant un immense trésor.</em></p>\\n\\n<p>Aladin fut soudain tiré de sa stupeur par une voix qui criait :<br />\\n-La lampe, la lampe, Aladin, apporte-moi la lampe !<br />\\nLe garçon regarda tout autour de lui et finit par apercevoir une vieille lampe à huile posée sur un coffre. Elle semblait bien terne au milieu de toutes ces richesses. Pourquoi son maître voulait-il cette lampe sans valeur alors que la caverne renfermait un immense trésor?</p>\\n\\n<p>Aladin prit la lampe et remonta lentement vers la surface.<br />\\n-Vas-tu te dépêcher ! reprit l'homme. Donne-moi la lampe !<br />\\n- Aidez-moi à sortir, répondit Aladin.<br />\\n- Donne-moi la lampe d'abord ! hurla l'homme.<br />\\nInquiet, Aladin mit la lampe dans sa poche et redescendit les marches sans répondre.<br />\\n- Eh bien, puisque tu t'y plais tant, reste ici pour l'éternité !<br />\\nEt, de rage, l'homme fit rouler la lourde pierre sur l'étroite ouverture.<br />\\nPerdu, seul dans le noir, Aladin se tordait les mains de chagrin et de désespoir.<br />\\nSoudain l'anneau qu'il portait au doigt se mit à briller. Une imposante créature apparut, avec des yeux comme des flammes. C’était un géant. Sa voix fit trembler la caverne :<br />\\n-Je suis le génie de l'anneau. Parle et j'obéirai !</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"19e21636-a367-4f3c-a96b-d089e6e3aed5\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAQEARwBHAAD/4QAiRXhpZgAATU0AKgAAAAgAAQESAAMAAAABAAEAAAAAAAD/2wBDAAIBAQIBAQICAgICAgICAwUDAwMDAwYEBAMFBwYHBwcGBwcICQsJCAgKCAcHCg0KCgsMDAwMBwkODw0MDgsMDAz/2wBDAQICAgMDAwYDAwYMCAcIDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAz/wAARCAGMA+gDASIAAhEBAxEB/8QAHwAAAQUBAQEBAQEAAAAAAAAAAAECAwQFBgcICQoL/8QAtRAAAgEDAwIEAwUFBAQAAAF9AQIDAAQRBRIhMUEGE1FhByJxFDKBkaEII0KxwRVS0fAkM2JyggkKFhcYGRolJicoKSo0NTY3ODk6Q0RFRkdISUpTVFVWV1hZWmNkZWZnaGlqc3R1dnd4eXqDhIWGh4iJipKTlJWWl5iZmqKjpKWmp6ipqrKztLW2t7i5usLDxMXGx8jJytLT1NXW19jZ2uHi4+Tl5ufo6erx8vP09fb3+Pn6/8QAHwEAAwEBAQEBAQEBAQAAAAAAAAECAwQFBgcICQoL/8QAtREAAgECBAQDBAcFBAQAAQJ3AAECAxEEBSExBhJBUQdhcRMiMoEIFEKRobHBCSMzUvAVYnLRChYkNOEl8RcYGRomJygpKjU2Nzg5OkNERUZHSElKU1RVVldYWVpjZGVmZ2hpanN0dXZ3eHl6goOEhYaHiImKkpOUlZaXmJmaoqOkpaanqKmqsrO0tba3uLm6wsPExcbHyMnK0tPU1dbX2Nna4uPk5ebn6Onq8vP09fb3+Pn6/9oADAMBAAIRAxEAPwD9/KKKKACiiigAooooAKKKKACiiigAooooAKKKKACiiigAooooAKKKKACiiigAooooAKKKKACiiigAooooAKKKKACiiigAooooAKKKKACiiigAooooAKKKKACv5kfsy/3T+df03V/Mr5f+9+Vft3g3/wAxn/cP/wBvPznxAlb2H/b/AP7aR7Ij/A1H2Zf7p/OrEUMkvRv/AB2oyuJNvzY+lftx+c+0I/sy/wB0/nR9mX+6fzqXyvZvypPL/wB78qA9oR/Zl/un86Psy/3T+dS+Vns35Uvk/wCy35UBzkP2Zf7p/Ok8mP0/WpvK9m/KrVvo8lx/q0J/CgPaGf5Mfp+tL5EZ/h/WrT2ckcm1vl+q0n2Yj7ryH6UB7Qr+VH/zzak8iP8Au/rVn7O+aPsZx3/KgOcrfZl/un86I7dF+8jH8asfYvrQbLA71LlYOe+hXkt0z91vzpnkqzccZ6e/+cH8qtmyMxXbuZmOFAGSx9vzH516l8BP2Gvix+1Fo39peB/Bd9qmjO7Qrql7cRWNlcOoyxikmceeAV2GSFZFBDDOQa5cdmWFwMPa4qcYrzf5HRh6FWtLkpQcvQ8jSAxdSv50nkLu3cbT0r6f1b/gj5+0RpfnLD4G03U4YoVnEmneIb bZH8zd94Nalt4Zhtn3edcN7Mw/wpX8OI77vtF0PYMuP5U/7Oq8urX4/wCQ/aIyJzIkS5iBY/ewOtdRWLL4Gs55/MeS5aT13j/CtqvoOHsLOj7Tmtrb9TmxEk7WCiiivpDlCiiigAooooAKKKKACiiigAooooAKKKKACiiigAooooAKKKKACiiigAooooAKKKKACiiigAooooAKKKKACiiigAooooAKKKKACiiigAooooAKKKKACiiigD//2Q==\",\"mime\":\"image/jpeg\",\"width\":1000,\"height\":396,\"copyright\":{\"license\":\"U\"}},\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"subContentId\":\"f44a42c2-84ca-4bb5-b481-f1fca75ebc9f\",\"metadata\":{\"license\":\"U\",\"contentType\":\"Image\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p>- Je veux rentrer chez moi, murmura Aladin.<br />\\nAussitôt, Aladin se retrouva auprès de sa mère, à qui il raconta son étrange aventure. Comme elle refusait de le croire, le garçon lui donna la vieille lampe. Alors, tout en l'écoutant, elle commença à astiquer<span style=\\\"font-size:0.75em\\\">(1)</span> la lampe pour lui donner un peu d'éclat pour pouvoir la revendre au marché.<br />\\nQuand elle eut frotté trois fois, il sortit de la lampe, au milieu d'une épaisse fumée, un autre génie encore plus effrayant que celui de l'anneau.<br />\\n- Je suis le génie de la lampe, parle et j'obéirai !</p>\\n\\n<p>A partir de ce jour, Aladin et sa mère ne manquèrent plus de rien. Le génie exauçait<span style=\\\"font-size:0.75em\\\">(2)</span> leurs désirs sur-le-champ. Ils devinrent même les personnes les plus riches et les plus généreuses de la région.</p>\\n\\n<p><span style=\\\"font-size:0.75em\\\">1. astiquer: nettoyer, faire briller.<br />\\n2. exaucer les désirs: réaliser les désirs.</span></p>\\n\\n<p> </p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"64f6f9c6-7bfd-4719-98da-b54879d2c81b\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"useSeparator\":\"auto\"},{\"content\":{\"par
